    function insertAfter(newNode, existingNode) {
        existingNode.parentNode.insertBefore(newNode, existingNode.nextSibling);
    }

    var intv = setInterval(function() {

        var existeMenu = document.querySelector('#menu-forja');

        if(existeMenu)
            return false;

        var elem = document.querySelector('[aria-label="Cargo"]');
        var elemNota = document.querySelector('[aria-label="Nota"]');
        var lang = 'pt-BR';

        if(!elem){
            elem = document.querySelector('[aria-label="Cargos"]');
            if(!elem){
                lang = 'en-US';
                elem = document.querySelector('[aria-label="Role"]');
                elemNota = document.querySelector('[aria-label="Note"]');
                if(!elem) {
                    elem = document.querySelector('[aria-label="Roles"]');
                    if(!elem) {
                        return false;
                    }
                }
            }
        }
        //when element is found, clear the interval.
        //clearInterval(intv);
        var emptyOption = document.createElement('option');
        var emptyOption2 = document.createElement('option');

        var menu = document.createElement('select');
        menu.style.marginTop = '30px';
        menu.id = "menu-forja";

        menu.appendChild(emptyOption2);

        rolesData.forEach(roles => {
            var option = document.createElement('option');
            option.innerText = roles.discord;
            option.value = roles.html;

            menu.appendChild(option);
        })

        var optionPT = document.createElement('option');
        optionPT.innerText = 'br';
        optionPT.value = 'pt-BR';

        var optionEN = document.createElement('option');
        optionEN.innerText = 'us';
        optionEN.value = 'en-US';

        var optionSelect = document.createElement('select');
        optionSelect.appendChild(emptyOption);
        optionSelect.appendChild(optionPT);
        optionSelect.appendChild(optionEN);

        var paragraph = document.createElement('p');

        //insertAfter(paragraph, elem);
        insertAfter(menu, elemNota);

        var dateElem = document.createElement('INPUT');
        dateElem.setAttribute('type', 'date');

        insertAfter(dateElem, menu);
        insertAfter(optionSelect, dateElem);

        var servername = document.querySelector('[data-text-variant="text-md/semibold"]').textContent;
        var badge = document.querySelector(`[aria-label="${servername}"]`);

        optionSelect.addEventListener('change', (event) => {
            lang = event.target.value;
        });

        dateElem.addEventListener('change', (event) => {
            const options = { year: 'numeric', month: 'short', day: 'numeric' };
            var date = new Date(event.target.value)

            var dateJoin = badge.nextSibling;
            console.log(lang);
            dateJoin.innerText = date.toLocaleDateString(lang, {month: 'short'}).replace('.','').toLowerCase() + ' ' + date.toLocaleDateString(lang, {day: 'numeric'}) + ', ' + date.toLocaleDateString(lang, {year: 'numeric'})

        });

        menu.addEventListener('change', (event) => {

            if(event.target.selectedIndex > 0) {
                var badgeData = rolesData[event.target.selectedIndex -1].badge

                badge.style.cssText = `background-image: url("${badgeData}");`;
                elem.setHTML(event.target.value);
            }
        });
    }, 1000);




